import React from 'react';
import './App.css';

import Customer from './components/Customer';
import Driver from './components/Driver';

function App() {
  return (
    <div className="App">
      <Customer username="Alejandro"/>
      <Driver username="frodo"/>
      <Driver username="merry"/>
      <Driver username="samwise"/>
    </div>
  );
}

export default App;
